import classNames from "classnames/bind";
import styles from './SendEmail.module.scss'
import stylesGrid from '~/styles/grid.module.scss' 

const cx = classNames.bind(styles)

function SendEmail() {

    return (
        <div className={`${cx('wrapper')} ${stylesGrid.grid}`}>
            <div className={` ${stylesGrid.grid__row-6} ${cx('logo')}`}></div>
            <div className={` ${stylesGrid.grid__row-6} ${cx('content')} `}>
                <div className={cx('header')}>
                <h4 class="content-header__heading">Active Your Account</h4>  
                <p class="content-header__title">To active your account, we need to verify your email. Please press the send button and check your email.</p>
                </div>
                <div className={cx('body')}></div>
            </div>
        </div>
    );
}

export default SendEmail;
